import React from "react";

//Local stuff.
import "../styles/main.scss";

class Home extends React.Component {
  render() {
    return (
      <div className="Home">
        <div className="header-container">
          <div>
            <h1 className="header">CompSciCalculator</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
